    private static void getCityList(String parentHref,String href,int level,String parentAllPath,List<Dept> deptList,String parentCode) throws Exception{
        //URL
        String cityListURL = String.format(URL_TPL,URL_PREFIX,href);
        Connection conn = Jsoup.connect(cityListURL).timeout(5000000);
        conn.header("Accept", "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8");
        conn.header("Accept-Encoding", "gzip, deflate, sdch");
        conn.header("Accept-Language", "zh-CN,zh;q=0.8");
        conn.header("User-Agent", "Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/55.0.2883.87 Safari/537.36");
        Document doc = conn.get();
        //JsouXpath的JXCDocument对象
        JXDocument jxDoc = new JXDocument(doc);
        List<JXNode> cityNodes = jxDoc.selN("//tr[@class='citytr']");
        if(CollectionUtils.isEmpty(cityNodes)){
            return;
        }
        for(JXNode cityNode : cityNodes){
            if(Objects.isNull(cityNode)){
                continue;
            }
            Element itemEle = cityNode.getElement();
            String curHref = itemEle.getElementsByTag("a").get(0).attr("href");
            String cityCode = itemEle.getElementsByTag("a").get(0).text();
            String cityName = itemEle.getElementsByTag("a").get(1).text();
            String cityAllPath = parentAllPath + "," + cityCode;

            int curLevel = level + 1 ;
            Dept city = new Dept();
            city.setLevel(curLevel);
            city.setName(cityName);
            city.setCode(cityCode);
            city.setParentCode(parentCode);
            city.setDeptAllPath(cityAllPath);
            deptList.add(city);
            if(StringUtils.isNotBlank(curHref)){
                getDistrict(href,curHref,curLevel,cityAllPath,deptList,cityCode);
            }

        }

    }

    private static void getDistrict(String parentHref,String href, int level, String parentAllPath, List<Dept> deptList,String parentCode)throws Exception {
        href = parentHref.substring(0,parentHref.lastIndexOf("/")+1) + href;
        //URL
        String districeURL = String.format(URL_TPL,URL_PREFIX,href);
        Connection conn = Jsoup.connect(districeURL).timeout(500000);
        conn.header("Accept", "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8");
        conn.header("Accept-Encoding", "gzip, deflate, sdch");
        conn.header("Accept-Language", "zh-CN,zh;q=0.8");
        conn.header("User-Agent", "Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/55.0.2883.87 Safari/537.36");
        Document doc = conn.get();
        JXDocument jxDoc = new JXDocument(doc);
        List<JXNode> districtList = jxDoc.selN("//tr[@class='countytr']");
        if(CollectionUtils.isEmpty(districtList)){
            return;
        }
        for(JXNode districtNode : districtList) {
            if (Objects.isNull(districtNode)) {
                continue;
            }
            Element itemEle = districtNode.getElement();
            if(CollectionUtils.isEmpty(itemEle.getElementsByTag("a"))){
                //logger.info(itemEle.html());
                continue;
            }
            String curHref = itemEle.getElementsByTag("a").get(0).attr("href");
            String districtCode = itemEle.getElementsByTag("a").get(0).text();
            String districtName = itemEle.getElementsByTag("a").get(1).text();
            String districtAllPath = parentAllPath + "," + districtCode;

            int curLevel = level + 1 ;
            Dept district = new Dept();
            district.setLevel(curLevel);
            district.setName(districtName);
            district.setCode(districtCode);
            district.setDeptAllPath(districtAllPath);
            district.setParentCode(parentCode);
            deptList.add(district);

           /* if(StringUtils.isNotBlank(curHref)){
                getTownList(href,curHref,curLevel,districtAllPath,deptList);
            }*/

        }
    }

